INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(13, , 'image/jpeg', '32991', 'Fisco: Renzi, impossibile accontentare tutti, ma le tasse ora giù', 'Il premier: "Rispetto al passato abbiamo cambiato marcia"', 'Le tasse ora scendono, prima andavano su. Lo rivendica il premier Matteo Renzi nella sua Enews. "Tutti convinti - scrive - che abbiamo fatto bene ad abbassare le tasse. Ma ciascuno ha la sua personale classifica di quelle che andavano tagliate e quelle che invece andavano mantenute. Impossibile accontentare tutti, dai. Però consapevolezza che rispetto al passato si è cambiato marcia: ora le tasse vanno giù, prima andavano su". \r\n\r\n"Lunedì prossimo - sottolinea Renzi - festeggiamo i primi due anni del governo. Per l''occasione incontrerò la stampa estera per dimostrare numeri alla mano come l''Italia sia tornata e abbia voglia di farsi sentire sempre di più". Lo annuncia il premier Matteo Renzi nella sua Enews. "E nel pomeriggio - prosegue - visiterò uno dei luoghi italiani che più di altri restituiscono il sapore del futuro, ma voglio che sia una sorpresa. Sarà una settimana all''insegna del JobsAct perché visiteremo anche tre aziende (una al nord, una al centro, una al sud) che hanno fatto assunzioni a tempo indeterminato grazie alla riforma".\r\n\r\n"Credo - dice ancora il premier - che l''Italia possa vincere tutte le sfide, anche quelle più difficili. Devono volerlo gli italiani, però. Credendoci. Per questo nei miei viaggi nei piccoli comuni, come nei grandi Paesi mi sforzo di incitare tutti a darci una mano. Questa gigantesca rivoluzione che stiamo facendo possiamo farla solo insieme".\r\n\r\n"Mercoledì sarò in Parlamento in vista del Consiglio Europeo che si terrà giovedì e venerdì. L''agenda europea continua a essere la priorità numero uno per tutti. Migrazione, crisi finanziaria, mancanza di stimoli per la crescita, ma io dico anche cultura e ricerca: la capitale europea di questa settimana non è stata Bruxelles, ma Cascina vicino a Pisa dove ricercatori italiani hanno svolto un ruolo decisivo nella scoperta delle Onde Gravitazionali".', NULL, 0, 12, 3, '2016-02-15 10:52:32', '2016-02-15 14:39:50', 3, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(14, , 'image/jpeg', '59176', 'Unioni civili: Alfano a Cattodem e M5s: ''Facciamo saltare la stepchild''', 'Lorenzin: "Sui bimbi serve un''altra legge"', 'Alla vigilia della battaglia in Aula sulle Unioni Civili è ''assalto'' alla stepchild adoption. L''agomento, sottolinea il ministro della Salute Beatrice Lorenzin dalle colonne del Corriere della sera va affrontato in un''altra legge. Mentre ieri il leader di Ncd e ministro dell''Interno Angelino Alfano aveva invitato Cattodem del Pd ed M5s a far saltare la norma.\r\n\r\nLorenzin, sui bimbi serve un''altra legge - "La mia idea è di affrontare con serenità il problema dell''utero in affitto in un testo a parte che riveda la legge sulle adozioni per tutti, parlo di coppie etero e omosessuali. C''è da mettere le mani sulla legge delle adozioni e cominciare a capire, per esempio, perché le liste di attesa per adottare i bambini sono così lunghe". Lo afferma il ministro della Salute Beatrice Lorenzin, che in un''intervista al Corriere della Sera ribadisce la propria volontà di stralciare la stepchild adoption dalla legge sulle unioni civili.\r\n\r\n \r\n\r\n"Spero - ha detto Alfano a ''In mezz''ora'' - che i Cattodem abbiano coraggio per votare no alla stepchild adoption e che numerosi grillini votino no in modo tale che la stepchild salti. Poi, se fossi il leader del Pd io la stralcerei". \r\n\r\nL''ala cattolica si scaglia inoltre contro il ''canguro'' a prima firma di Andrea Marcucci e chiede lo spacchettamento dell''emendamento sulle adozioni in due parti, una sui diritti e una sulla stepchild. La partita, insomma, è apertissima laddove una terza via tra lo stralcio e l''approvazione tout court della stepchild resta difficilissima.\r\n\r\nI numeri (di Giovanni Innamorati) - I numeri già solitamente ''stretti'' del Senato, renderanno incerte le votazioni sugli emendamenti al ddl Cirinna'' sulle unioni civili e, soprattutto, sul punto della stepchild adoption. Con il canguro Marcucci che incombe, e la probabile ipotesi di un suo spacchettamento, è il voto sulla seconda parte dell''emendamento a vedere i numeri quanto mai in bilico. Numeri che, nel caso la votazione si faccia a scrutinio segreto, potrebbero ulteriormente cambiare lasciando apertissima la partita tra l''approvazione e la bocciatura della stepchild. Il Pd ha 112 senatori, che si riducono però a 111 visto che il presidente Pietro Grasso non vota. Di questi ci sono circa 25 cattoDem, contrari alla stepchild adoption, a cui si aggiungono altri parlamentari di area laica per un totale di 30. Tra i 35 senatori di M5S 29/30 dovrebbero essere favorevoli all''articolo 5 sulle adozioni, come ribadito anche oggi da Gianluca Castaldi, che parla di un "90%" del Movimento favorevole all''art.5. Schierati per il si anche i sei parlamentari di Sel, e altri 14 senatori oggi nel gruppo Misto e usciti in precedenza da M5s, Pd e Sinistra ecologia e libertà. Al fronte dei sì va aggiunto, sulla carta, anche il gruppo dei 19 verdiniani che, almeno in buona parte, potrebbe dare l''ok alla stepchild. Tutto da vedere l''atteggiamento dei 19 senatori del gruppo delle Autonomie: ci sono parlamentari di matrice cattolica, come i 6 della Svp, di Uv e del Patt, o i due ex Sc, ma ci sono anche i laici come due ex M5s che dovrebbero votare la stepchild adoption, così come i due socialisti e due senatori eletti all''estero. Tra i banchi delle autonomie siedono poi i senatori a vita Elena Cattaneo, Renzo Piano, Carlo Rubbia, Carlo Azeglio Ciampi, Giorgio Napolitano. E resta un''incognita anche il voto sulla stepchild di Mario Monti che siede nel gruppo Misto. Sul fronte del no si schiera tutto il gruppo di Ap (32), Cor (9), Lega (12), circa 35 dei 41 senatori Fi, i 15 senatori Gal e le 3 esponenti tosiane. Sulla carta, dunque, i si'' sicuri e i "no" si equivalgono. I primi superano le 150 unità arrivando quasi a quota 170 con l''ok del gruppo Autonomie (e, comunque, con un via libera della gran parte di Ala) mentre i no sicuri si attestano comunque sulle 150 unità. Anche se, sul computo, oggi dai Cattodem filtra ottimismo: i no alla stepchild arriveranno a 164, è la loro previsione. Ma, con il voto segreto, ogni soluzione sembra possibile, anche quella di un allargamento dei sì alla stepchild in funzione filo-governativa.', NULL, 0, 31, 7, '2016-02-15 14:44:07', '2016-02-15 15:49:57', 3, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(15, , 'image/jpeg', '26531', 'Terrorismo: Alfano, "Rischio molto alto, clima non sereno"', 'Il ministro a In 1/2 ora: "L''Italia è stato finora un paese sicuro perché abbiamo fatto un lavoro di prevenzione continuo giorno e notte. Ma il rischio zero non esiste"', '"Abbiamo analisi che non lasciano prevedere un clima sereno per gli anni a venire. Ma l''Italia è stato finora un paese sicuro perché abbiamo fatto un lavoro di prevenzione continuo giorno e notte. Ma il rischio zero non esiste. Il rischio è molto alto come per gli altri Paesi che hanno subito attentati: siamo parte di una comunità che è oggetto delle ritorsioni dei terroristi". Lo ha detto il ministro dell''Interno Angelino Alfano a "In 1/2 ora" interpellato sull''allarme terrorismo lanciato dal il premier francese Manuel Valls.\r\n\r\n"Non abbiamo notizie di allarme concreto e specifico" ma "questo non ci fa stare tranquilli. Ho sempre detto che il rischio è alto" in Italia c''è una "prevenzione notte e giorno ma nessun Paese è a rischio zero, il rischio zero non esiste", aggiunge Alfano.', NULL, 0, 0, 0, '2016-02-15 11:46:53', '2016-02-15 11:46:53', 3, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(16, , 'image/jpeg', '38724', 'Borsa: Europa conferma rialzo, Milano maglia rosa (+4,3%)', 'Continua la corsa dei bancari, spread sotto i 133 punti', 'Le Borse europee confermano la buona seduta con il mercato che vive una nuova fase di ottimismo sulle attese di stimoli da parte della Banca centrale europea. L''indice d''area Stoxx 600 sale di oltre il 3% con banche e auto in particolare evidenza. Maglia rosa resta sempre Milano (Ftse Mib +4,3% a 17.177 punti), seguita da Parigi (+3,49%), Madrid (+3,35%). Francoforte sale del 2,92% mentre Londra del 2,15 per cento. A Piazza Affari prosegue il rimbalzo di Mps (+9,43%) così come quello di Saipem (+11,7%). Fuori dal paniere principale in evidenza Carige (+11,4%). Lo spread tra Btp e Bund è sotto i 131 punti base.\r\n\r\n \r\n\r\nCina: giù export a gennaio (-6,6%), import a -14,4% - Gli scambi commerciali segnano il passo a gennaio per la Cina registrando un tonfo dell''export del 6,6%, a 175 miliardi di dollari, a fronte di un import in un più marcato arretramento (-14,4%, a 114,2 miliardi). I dati diffusi dalle Dogane cinesi sono ulteriori segnali di debolezza dell''economia se confrontati, rispettivamente, con le flessioni dell''1,4% e del 7,6% avuti a dicembre.', NULL, 1, 0, 0, '2016-02-15 12:45:24', '2016-02-15 12:45:24', 4, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(17, , 'image/png', '155411', 'Professioni, arrivano le App personalizzate dell''ANSA', 'In un click tutte le news utili al mondo dei professionisti', 'In un click, tutto quello che serve a un professionista per essere costantemente informato, in tempo reale, su ciò che accade e si muove nel proprio mondo: arrivano le nuove App personalizzate di ''ANSA PROFESSIONI'', dedicate a chi, grazie a un flusso costante di notizie, vuole sfruttare al meglio opportunità di business, novità e modifiche delle normative italiane ed europee, aggiornamenti continui in materia di lavoro, previdenza, welfare.\r\n\r\n\r\nL''esperienza, l''affidabilità e il prestigio dell''ANSA, prima agenzia giornalistica italiana, al servizio dei professionisti, che potranno scaricare e consultare sui propri Smartphone e Tablet (Apple e Android) tutte le news di settore su formazione, lavoro e attività istituzionali, informazioni sulla propria Cassa di Previdenza e sul proprio ambito professionale, attività legislativa del Parlamento Italiano e delle commissioni Ue, rassegna stampa quotidiana personalizzata, top news della giornata e sviluppi di tutte le notizie economiche, i Telegiornali e la prima pagina con la quale si apriranno i giornali di domani.\r\n\r\n\r\n\r\n \r\n\r\nIl progetto nasce da una collaborazione con Adepp, l''associazione delle Casse previdenziali private dei professionisti, e si aggiunge al portale ANSA PROFESSIONI. \r\n\r\nProfessioni, arrivano le App personalizzate dell''Ansa GUARDA LA CLIP\r\n\r\nDa oggi la App, personalizzata per ciascuna Cassa di previdenza e gratuita per un periodo di tre mesi, è scaricabile dagli Store Apple e Google Play su tutti i terminali mobili e PC. La veste grafica agile e intuitiva consente di accedere con facilità alle varie sezioni della app e di sfogliarne velocemente i contenuti continuamente aggiornati. All''interno di ogni argomento sono visibili le ultime notizie (in primo piano con foto), gli approfondimenti, i dossier e la possibilità di accedere all''archivio.\r\n\r\n\r\n\r\nCliccando sull''icona della App si entrerà sulla Homepage ricca di rubriche, per accedere subito alla consultazione dei contenuti. Dalle ''Top News ANSA'' (le Notizie più importanti del giorno, in tempo reale, con aggiornamento h24 di cronaca, politica, economia, mondo) ad ''ANSA in diretta'' (rassegna ragionata delle prime pagine dei quotidiani, interviste e le notizie più importanti del giorno e l''aggiornamento 4 volte al giorno dei principali eventi in corso, selezionati da ANSA).\r\n\r\n\r\n\r\nRicca e approfondita la sezione dedicata a ''Previdenza e Welfare'' (news di settore su welfare, lavoro, attività istituzionali), mentre la rubrica dedicata alla ''Tua Professione'' contiene contenuti specifici riguardanti la Cassa e l''attivita dei Professionisti del settore. Molto analitica anche la parte ''Normativa'': dalle news sulla legislazione di settore, alle iniziative parlamentari e al dibattito politico riguardo ai temi di interesse, i dibattiti, la vita delle le commissioni.\r\n\r\nLa vocazione fortemente multimediale della app consente di seguire anche in video l''evoluzione dei fatti del giorno, con brevi clip che mettono a fuoco gli elementi centrali degli argomenti in via di sviluppo. \r\n', NULL, 0, 0, 0, '2016-02-15 12:47:13', '2016-02-15 12:47:13', 4, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(18, , 'image/jpeg', '158359', 'Bankitalia: debito 2015 a 2.169,9 miliardi, supera 2014', '+33, 8 mld in un anno. Ma a dicembre segna calo su novembre', 'A fine dicembre 2015 il debito delle Amministrazioni pubbliche si è attestato 2.169,9 miliardi. Lo comunica Bankitalia nel Supplemento "Finanza pubblica, fabbisogno e debito" precisando che il debito è salito di 33,8 miliardi rispetto a fine 2014, quando ammontava a 2.136,0 miliardi (132,4 per cento del PIL). Il debito di fine dicembre è invece calato rispetto a quello di novembre 2015 quando si era attestato a 2.212 miliardi.\r\n\r\n \r\n\r\nDeciso aumento delle entrate nel 2015. A fine dicembre scorso, le entrate tributarie sono state infatti pari a 433.483 milioni di euro, con un incremento del 6,4% rispetto ai 407.579 milioni dello stesso mese del 2014. Lo comunica la Banca d''Italia nel "Supplemento finanza pubblica, finanza e debito". Nel solo mese di dicembre le entrate tributarie si sono attestate a 80.144 milioni di euro, contro i 68.525 di dicembre 2014.', NULL, 1, 0, 0, '2016-02-15 14:47:54', '2016-02-15 14:45:54', 4, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(19, , 'image/jpeg', '51844', 'Petrolio, partita dall''Iran prima petroliera dopo fine sanzioni', 'Teheran invierà 4 milioni di barili all''Europa', 'E'' partita dall''Iran la prima petroliera che segna il ritorno del Paese sul mercato del greggio europeo dopo la fine delle sanzioni. Secondo quanto riferisce l''agenzia Bloomberg la nave Distya Akula (una cosiddetta Suezmax, vale a dire le cui dimensioni consentono il passaggio nel Canale di Suez) è partita ieri dall''isola di Khark nel Golfo Persico. Le petroliere Suezmax possono trasportare fino a un milione di barili di petrolio e, stando al livello di immersione dell''imbarcazione nel mare, dovrebbe essere piena. Il ministero del petrolio di Teheran aveva annunciato ieri che entro 24 ore sarebbero partite tre petroliere con 4 milioni di barili di greggio a bordo, dirette verso l''Europa: due sono destinati alla Total e due a compagnie spagnole e russe. \r\n\r\nPetrolio su montagne russe, da Iran 4mln barili a Europa  - Prima il capitombolo ai minimi da 12 anni, il giorno dopo il rimbalzo fino a quasi 30 dollari. Sono le montagne russe del prezzo del petrolio, che, tra i difficili tentativi di alcuni paesi produttori di tornare a livelli di normalità, lo scetticismo di molti analisti e la speculazione che impazza, non riesce a trovare una direzione e un equilibrio che consenta al mercato di fare delle scelte di investimento basate sulla solidità. L''Iran, intanto, torna alla grande sul mercato europeo e invia 4 milioni di barili. L''attesa, come è ovvio, è per le mosse dell''Opec e, in particolare, per la sensibilità che alcuni sperano di trovare nell''Arabia Saudita, da più parti indicata come il motore dell''attuale andamento dei mercati. Il Paese che con maggiore costanza e impegno si sta muovendo per convincere Paesi Opec e non Opec ad agire è il Venezuela, che proprio a causa del crollo dei prezzi del greggio rischia addirittura il default: il presidente Nicolas Maduro oggi ha detto chiaramente in tv che il prezzo "non tornerà più a 100 dollari al barile". Questo non vuol dire, però, che ci si debba rassegnare, come ha spiegato il ministro del Petrolio di Caracas, Eulogio Del Pino, a lasciare che l''oro nero, "un bene non rinnovabile ma fondamentale per l''umanità, finisca preda del mercato degli speculatori". \r\n\r\nPer questo il Paese sudamericano si sta facendo in quattro per convincere i colleghi dell''Opec, ma anche i produttori esterni come la Russia, a un''azione comune mettendo a punto dei "meccanismi" che, ha auspicato Maduro, possano trovare consenso. Lo scetticismo rispetto a questo genere di soluzioni, tuttavia, è abbastanza diffuso tra gli analisti. Oilprice.com, uno dei principali siti del settore, sostiene infatti che non ci sarà nessun taglio da parte del Cartello, per almeno un paio di buone ragioni: la prima è che la strategia dei prezzi bassi sta centrando l''obiettivo, vale a dire mettere in difficoltà i produttori di shale oil americani, che come ha evidenziato di recente Standard & Poor''s stanno effettivamente collezionando fallimenti a catena; la seconda è che in realtà la produzione Opec sta aumentando e crescerà ancora con l''ingresso dell''Iran sul mercato: basti pensare che entro 24 ore Teheran invierà 4 milioni di barili all''Europa (due alla Total e altri due a compagnie russe e spagnole). In assenza di contromisure, comunque, il prezzo potrebbe in ogni caso tornare a un livello più rassicurante per i paesi produttori e per le grandi major petrolifere per la metà del 2017: la previsione è del presidente della Kuwait Petroleum International (Q8), Bakheet Al-Rashidi, che spera in "50-60 dollari al barile". Di certo la situazione attuale, che pure porta benefici ai consumatori, non tranquillizza la Bce: il crollo del greggio e il rallentamento della crescita rappresentano "nuovi rischi" per l''economia, anche rispetto a dicembre, ha avvertito il componente del consiglio esecutivo di Francoforte, Benoit Coeuré.', NULL, 0, 0, 0, '2016-02-15 12:51:23', '2016-02-15 12:51:23', 4, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(20, , 'image/jpeg', '253684', 'Champions League: rivincita Psg-Chelsea, tornano emozioni', 'Real ritrova Spalletti. Europa League, big match Napoli e Fiorentina', 'Orfana di tre personaggi da copertina come Mourinho, Benitez e Garcia,dopo un letargo di due mesi torna la Champions con gli ottavi che verranno centellinati in un mese. L''andamento lento, che stride con quello garibaldino della Europa League che riparte dai 16/i , non lesinera'' comunque spettacolo ed emozioni visto il calendario ricco di sfide interessanti.\r\n   \r\n\r\nSi parte domani con il clou al Parco dei Principi tra il lanciato Psg di Blanc e il claudicante Chelsea che Hiddink ha ereditato dalla deficitaria stagione di Mourinho. Se l''anno scorso l''eliminazione dei Blues fu sorprendente e venne un po'' casualmente dopo un doppio pareggio e il 2-2 nei supplementari di Thiago Silva, questa volta i parigini (che hanno prolungato il contratto di Verratti fino al 2020, sottraendolo alle mire del Barcellona) sono favoriti. In Francia non perdono da 40 partite, hanno un vantaggio sulla seconda di 24 punti e venerdi'' hanno pareggiato col Lilla dopo una striscia di 16 vittorie.\r\n\r\nVero e'' che rimane sospesa una certa insoddisfazione di Cavani, i tifosi sono un po'' freddi e proprio nel weekend e'' scoppiata una dura polemica per gli insulti omofobi di Aurier al proprio allenatore, ma il Psg sembra avere una marcia in piu''. Anche se il Chelsea sta gradatamente riprendendosi e con Hiddik ha inanellato 10 risultati utili di fila. Di caratura inferiore l''altro ottavo di domani Benfica-Zenit: i portoghesi hanno subito il ko sabato nel duello storico col Porto in casa, ma i russi hanno l''handicap della lunga sospensione invernale, cui hanno cercato di sopperire con lunghi stage in Qatar, Portogallo e Spagna. Per Villas-Boas sara'' un suggestivo ritorno in patria.\r\n\r\nMercoledi'' riflettori puntati sull''Olimpico per un''altra sfida, Roma-Real coi madrileni che hanno licenziato Benitez proponendo in panchina Zidane. Il grande campione ha avuto un impatto positivo ma il Real, al solito, vive sugli spunti di un attacco atomico, non sempre supportato da una fase difensiva impeccabile. Le merengues hanno hanno segnato 70 reti, 8 piu'' della macchina da gol blaugrana, il doppio dell''Atletico. Senza Bale, Pepe e Marcelo troveranno una Roma in ripresa con la nuova gestione di Spalletti, che li elimino'' negli ottavi di otto anni fa. Il Real peraltro e'' fuori dalla Coppa del Re per aver mandato in campo un giocatore squalificato, e in Liga e'' a -4 dal Barca che deve recuperare una gara. Insomma, si gioca tutto in Champions. Scarso appeal dimostra l''altro confronto di mercoledi'', col Gand primo in Belgio che affronta il deludente Wolfsburg, che 8/o in Bundsliga a -5 dall''ultimo posto Champions.\r\n\r\nLa prossima settimana presentera'' poi due super sfide, Arsenal-Barcellona e Juve-Bayern, e due di livello molto inferiore, Dinamo Kiev-City e Psv-Atletico Madrid.\r\nRicco e affascinante il programma di giovedi'' di Europa League con tre impegni di cartello per le italiane presenti ai 16/i. Il Napoli potra'' verificare se il ko in casa Juve per un tiro rimpallato di Zaza avra'' lasciato strascichi. Giochera'' in casa del Villarreal che, approfittando della crisi di Siviglia e Valencia, ha blindato il quarto posto Champions in Liga: sabato ha battuto il Malaga con un gol di Soldado e ha un gruzzolo di otto punti sulla quinta. Ancora piu'' arduo il compito che attende la Fiorentina col morale a mille dopo il successo sull''Inter: i viola ospiteranno il Tottenham, reduce dal successo in casa del Manchester City che l''ha proiettato al secondo posto della Premier. Meno complicato il compito di una Lazio in ripresa che affronta un Galatasaray precipitato al quinto posto in Turchia, nella sfida tra i due veterani tedeschi Klose e Podolski. Ma gol e spettacolo sono attesi, negli altri incontri, da Anderlecht-Olympiacos, Dortmund-Porto, Sporting-Leverkusen e Shakhtar-Schalke. Dopo una lunga fase a gironi Champions e Europa League tornano alle sfide spietate di andata e ritorno, supplementari e rigori, quelle che il pubblico preferisce. ', NULL, 0, 0, 0, '2016-02-15 12:59:50', '2016-02-15 14:39:19', 5, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(21, , 'image/jpeg', '32002', 'Palermo: torna Iachini. Zamparini: "Chiedo scusa per il caos"', 'Presidente: "Mantenere la categoria sarà come una promozione"', ' Il Palermo ha richiamato Giuseppe Iachini e tutto il suo staff. "La Società - si legge in una nota - ringrazia per la disponibilità mostrata in questo difficile momento di transizione il responsabile del settore giovanile Dario Baccin e l''allenatore della Primavera Giovanni Bosi".   \r\n\r\nZamparini, chiedo scusa per il caos - "Chiedo perdono per questo mese di caos, che eventi paradossali hanno provocato, con l''auto-allontanamento di Ballardini e Schelotto: spero che non tutti i mali vengano per nuocere poiché il caos, dovuto anche a mie errate valutazioni e incomprensioni con Iachini, ha permesso di ricomporre un matrimonio con lo stesso Beppe, che spero, con la massima collaborazione di entrambi, ci riporti ai successi che Palermo merita". Così il presidente Maurizio Zamparini ha commentato il ritorno in panchina di Beppe Iachini, dopo la parentesi di Giovanni Bosi. "Desidero ringraziare per la sua massima disponibilità Beppe Iachini, che ritorna sulla panchina - aggiunge - in un difficile momento per la squadra. Sono certo che con la sua grinta e il suo lavoro farà uscire la società da questa crisi di risultati, con lo stesso spirito che ci ha portato dalla serie B alla serie A. Mantenere la categoria sarà come un''altra promozione. Sarà necessario il massimo sostegno della splendida tifoseria palermitana, che con la sua passione ed energia dovrà aiutare la squadra in questo difficile momento".', NULL, 1, 0, 0, '2016-02-15 13:05:44', '2016-02-15 15:05:22', 5, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(22, , 'image/jpeg', '58442', 'Premier League: cade il Leicester, Arsenal e Tottenham a -2 dalla vetta ', 'Gunners beffano Ranieri al 94''. Spurs battono a Manchester il City. Liverpool a valanga', 'Si riapre la corsa in Premier League. Seconda sconfitta di fila per il Manchester City di Manuel Pellegrini, che dopo essersi inchinato al Leicester City perde 2-1 in casa con il Tottenham Hotspur e si trova ora quarto in classifica. Gli Spurs salgono invece al secondo posto a fianco dell''Arsenal e a soli due punti dalle Foxes di Ranieri, battute poche ore fa dagli stessi Gunners.\r\n\r\n \r\n\r\n\r\n \r\n\r\nPerde intanto terreno il Manchester United, battuto ieri a Sunderland e staccato di sei punti dai cugini e dalla relativa zona Champions. La partita all''Ethiad Stadium ha visto andare in vantaggio il Tottenham con un rigore di Kane a inizio ripresa, poi il pareggio di Iheanacho alla mezz''ora, annullata al 38'' da Eriksen. Un colpo alle ambizioni del City, mentre il Tottenham conferma il suo grande stato di forma e le aspirazioni di altissima classifica. Nella terza partita domenicale della 26/a giornata di Premier League, il Liverpool ha vinto 6-0 sul campo dell''Aston Villa ultimo in classifica.\r\n\r\nRanieri beffato - Vittoria in rimonta e all''ultimo respiro (94'') per l''Arsenal nel big match della 26/ma giornata di Premier contro la capolista Leicester. La squadra di Ranieri, che fino ad oggi guidava la classifica con 5 punti di vantaggio sui Gunners e il Tottenham, era andata in vantaggio a fine primo tempo con un rigore trasformato da Vardy. Determinante per i Foxes il doppio cartellino giallo di Simpson al 9'' del secondo tempo. In superiorità numerica, l''Arsenal ha trovato il pareggio al 25'' con Walcott e poi assediato la porta del Leicester con Schmeichel grande protagonista con una serie di grandi parate. Il gol del sorpasso è arrivato a 30" dalla fine con un gran colpo di testa di Welbeck, su punizione calciata da Ozil, che si è infilato nell''angolino alla destra del portiere. In classifica il Leicester resta a 53 punti, mentre l''Arsenal sale a 51, in attesa dello scontro diretto tra City (47 punti) e Tottenham (48).\r\n\r\n\r\n\r\nSgambetto di Graziano Pellè a Francesco Guidolin che, alla guida dello Swansea (e con Alberto Paloschi in campo) perde la sua prima partita di Premier League. Al Liberty Stadium vince il Southampton 1-0 grazie a un gol di Long che decide il match. A far rumore è l''ennesima caduta del Manchester United (2-1 in casa del Sunderland), con Van Gaal che dice "ora sarà molto difficile arrivare fra le prime 4". Il Chelsea incamera il decimo risultato utile consecutivo sotto la guida di Guus Hiddink con un rotondissimo 5-1 al Newcastle che resta in pericolosa zona retrocessione. Fra gli altri, va a segno Diego Costa, bomber ''in maschera'' per via di una frattura al setto nasale. Nella altre gare della giornata, pari in rimonta del West Ham col Norwich, mentre lo Stoke City maramaldeggia a Bournemouth (3-1 e solo 15'' per Iturbe), mentre il Watford viola il campo del Crystal Palace (1-2). Infine, vittoria 1-0 del West West Browmich sul campo dell''Everton.\r\n\r\nGiornata no per il Manchester United di Louis Van Gaal. All''indomani delle stizzite dichiarazioni del tecnico olandese, che ha allontanato l''ombra di Mourinho - candidato a sostituirlo l''anno prossimo - dichiarando di voler rispettare il suo contratto, i Red Devils hanno perso per 2-1 a Sunderland, sul campo della penultima in classifica e vedono sempre più lontana la zona-Champions. Vantaggio locale al 3'' grazie a una punizione-cross di Khazri che beffa De Gea, pari al 39'' con Martial, ma un paio di minuti prima si fa male Darmian. L''esterno italiano ex Torino, dolorante alla spalla sinistra, viene portato in ospedale per accertamenti. Nella ripresa sul corner di Khazri, all''82'', Kone insacca per il definitivo 2-1.', NULL, 0, 0, 0, '2016-02-15 13:09:34', '2016-02-15 13:09:34', 5, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(23, , 'image/jpeg', '69319', 'Regeni, Il Cairo smentisce i media occidentali', 'Ministero Interno, non è stato preso da servizi egiziani', '"In un comunicato ufficiale pubblicato dal ministero dell''Interno, una fonte del Dipartimento dell''informazione ha smentito le informazioni pubblicate dai media occidentali secondo le quali l''accademico italiano Giulio Regeni sarebbe stato arrestato da elementi appartenenti ai servizi di sicurezza prima della sua morte": lo riportano molti media egiziani tra cui l''agenzia ufficiale Mena.\r\n\r\n"La fonte afferma che media occidentali avevano pubblicato informazioni completamente erronee circa le condizioni della scomparsa dell''italiano e aggiunge che una grande squadra di indagine è incaricata di svelare i moventi dell''omicidio dell''italiano e che questa squadra coopera pienamente con la controparte italiana", viene aggiunto nel testo che conclude: "i risultati delle ricerche e delle indagini su questo caso saranno annunciati quando porteranno a risultati utili".\r\n\r\nRegeni: inquirenti Italia puntano pista apparati Egitto \r\n(di Claudio Accogli)\r\nContinuano le indagini sulla tragica morte al Cairo di Giulio Regeni ma con il passare dei giorni, apprende l''ANSA, si accredita con sempre maggior forza tra gli inquirenti italiani l''ipotesi di un "coinvolgimento" di apparati egiziani nella vicenda. Gli investigatori inviati da Roma al Cairo faticano a raccogliere elementi sulla fine del ricercatore friulano: ciò potrebbe dipendere anche dalle metodologie di indagine utilizzate dagli inquirenti egiziani, molto diverse da quelle italiane. E'' il caso dei filmati delle telecamere di video-sorveglianza di alcuni negozi nella zona dove Regeni è scomparso: la Procura egiziana li ha acquisiti solo nelle ultime 48 ore, e li sta "vagliando", riferiscono fonti giornalistiche e giudiziarie nella capitale egiziana. Ieri, in una ridda ormai quotidiana di indiscrezioni e mezze verità, ha destato clamore il testimone citato dal New York Times, secondo il quale il fermo dell''italiano sarebbe stato "ripreso da quattro telecamere di sorveglianza" di altrettanti negozi del quartiere. Secondo questa ricostruzione, avvalorata da tre fonti della sicurezza egiziana sempre al Nyt, non meglio precisati "agenti" avrebbero fermato il giovane, e dopo l''identificazione e la perquisizione del suo zaino "lo hanno portato via". Ritardi si segnalano anche nell''esame dei tabulati telefonici, che sarebbero arrivati sul tavolo degli inquirenti egiziani solo ieri. "La procura generale ha ricevuto tabulati telefonici che mostrano" come "l''ultima chiamata è stata fatta al suo amico italiano Gennaro" Gervasio "ed è durata 20 minuti", scrive l''autorevole al Ahram, il principale quotidiano del Paese. Il telefono di Regeni, come è già noto, è scomparso. Dunque, la raccolta di prove prosegue, in attesta di un quadro più definito di quanto accaduto quella sera del 25 gennaio, quando il giovane è scomparso. Le indiscrezioni pubblicate dalla Reuters sulla perizia medico-legale acquisita dalla Procura di Giza e secretata confermano i segni, terribili e inequivocabili, delle tortura, con altri tremendi particolari: le sette costole rotte e le tracce di scosse elettriche sui genitali. Una ''metodologia'' che gli attivisti egiziani, sia quelli legati ai Fratelli musulmani che alla variegata galassia dell''opposizione laica anti-governativa, denunciano da mesi, parlando di torture sistematiche nei commissariati e nelle carceri del Paese, che contano il dato ''record'' di oltre 40.000 detenuti politici, accusati a vario titolo di sovversione e terrorismo. Il caso Regeni continua intanto ad agitare il dibattito politico italiano: "Perché l''emozione nel Paese non è a livello delle notizie terribili che arrivano dal Cairo?", ha chiesto oggi l''ex premier Enrico Letta. "Regeni fu torturato a morte. Il regime egiziano riconosca le proprie responsabilità e aiuti la verità", ha incalzato invece il capogruppo dei deputati di Sinistra Italiana, Arturo Scotto. E mentre la vicepresidente del Pd Debora Serracchiani ha accostato la figura del giovane ricercatore a quella di Giancarlo Siani e Giorgiana Masi, il presidente dei deputati di Forza Italia, Renato Brunetta, ha chiesto che siano salvaguardati "i rapporti Italia-Egitto" ma che il governo "faccia di più" per "trovare la verità".(ANSA).\r\n\r\n\r\nIl legale della famiglia del ricercatore friulano, Alessandra Ballerini, ha invitato però alla cautela: "E'' difficile avere riscontri su testimonianze egiziane, dobbiamo fidarci delle fonti ma intanto viene pubblicato di tutto", ha detto, esprimendo fiducia nelle indagini condotte dalla Procura di Roma. Dopo le rivelazioni del Nyt il Movimento 5 Stelle è insorto: il portavoce Manlio Di Stefano ha chiesto un Commissione d''inchiesta Onu per accertare fatti e responsabili, intimando al governo di interrompere immediatamente ogni relazione diplomatica con l''Egitto. Mentre Alessandro Di Battista ha definito "vergognoso che notizie su Regeni ci arrivino da media stranieri. Italia da zerbino europeo a tappeto arabo", ha twittato. Al Cairo intanto il ministro degli Esteri egiziano Sameh Shoukry ha sottolineato che nei colloqui con Roma "non viene sollevata una simile illazione o accusa", ovvero il coinvolgimento di forze di sicurezza egiziane nella morte di Regeni. Il ministro poi ha avvertito: l''Egitto ha un numero "molto alto" di "emigrati in Italia" che, da vittime, "affrontano quotidianamente un''attività criminale". "Se facessi illazioni che quell''attività criminale è in qualche modo connessa al governo italiano, sarebbe molto difficile condurre relazioni internazionali". Proseguono infine le indagini. La perizia medico-legale egiziana sulla morte di Regeni è stata consegnata alla Procura di Giza, che ha deciso di non renderla pubblica, almeno per il momento, a causa del carattere di "segretezza delle indagini sul caso". Eppure in serata sono arrivate le indiscrezioni della Reuters, che cita una fonte medico-legale non essendo in possesso del documento. In Italia, il pm Sergio Colaiocco, titolare dell''inchiesta, ha ascoltato la sorella di Giulio, Irene, e un''amica, entrambe nella qualità di persone informate sui fatti. Il Ros e lo Sco avrebbero inoltre acquisito materiale informatico.', NULL, 1, 0, 0, '2016-02-15 14:45:13', '2016-02-15 14:46:22', 6, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(24, , 'image/jpeg', '147872', 'Studente muore in classe, tre indagati', 'L''incidente nell''Istituto Alberghiero della cittadina abruzzese', 'Sono tre gli indagati per la morte di Christian Lombardozzi. Si tratta della dirigente scolastica, Maria Paola De Angelis, dell''insegnante di biologia, Dino Di Meo, che al momento si trovava in classe, e di Michele Verratti, responsabile della società di consulenza che si occupa della sicurezza dell''istituto scolastico. Ai tre è stato notificato l''avviso di garanzia per partecipare agli esami peritali di prossimi giorni. L''accusa è di concorso in omicidio colposo.\r\n\r\n LA TRAGEDIA IN CLASSE DURANTE UNA LEZIONE\r\n\r\nStava seguendo la lezione di alimentazione quando, dalle prime testimonianze, è scivolato dalla sedia sbattendo la nuca sul muro. È morto così Christian Lombardozzi, sedicenne di Castel di Sangro (L''Aquila).\r\n\r\nL''incidente è avvenuto all''interno di un''aula dell''Istituto Alberghiero di Roccaraso. A soccorrerlo il medico della scuola che ha potuto fare ben poco, come ha dovuto alzare le mani il rianimatore giunto dall''Aquila con l''elicottero del 118. Dalle prime informazioni sembrerebbe che il 16enne sia caduto dopo lo lo scivolamento della sedia per dondolio sbattendo poi la nuca sul muro. \r\n\r\nSecondo quanto si è appreso, ci sarebbero state due sedie fuori norma, in plastica, nella classe dell''istituto alberghiero Marchitelli dove è morto Lombardozzi e, su una di queste era seduto proprio il ragazzo. Christian avrebbe provocato la deformazione della sedia con il dondolio della stessa e sarebbe così caduto. Tra l''altro, dalle testimonianze rese dai compagni di classe, si è appurato che pochi giorni fa Lombardozzi era stato protagonista di una caduta analoga.', NULL, 0, 0, 0, '2016-02-15 13:42:07', '2016-02-15 13:42:07', 6, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(25, , 'image/jpeg', '81429', 'Percosse a pazienti disabili, sospesi 14 operatori', 'Blitz Cc in centro Aias a Cagliari dopo denuncia dipendente', 'Maltrattamenti, percosse, lesioni personali, omissione di referto nei confronti degli ospiti affetti da gravi e croniche forme di disabilità psicofisica.\r\n\r\nSono queste le accuse contestate a 14 operatori dell''Aias di Decimomannu (Cagliari), ai quali in queste ore i carabinieri del Comando provinciale e di Cagliari e gli specialisti del Nas stanno notificando le misure cautelari di sospensione dal pubblico servizio per sei mesi. A far partire le indagini, coordinate dal pm Liliana Ledda, sarebbe stato l''esposto di un dipendente dell''Aias.\r\n\r\nSecondo quanto emerso dalle indagini dei militari, iniziate nel 2014, i 14 operatori avrebbero maltrattato alcuni ospiti, tutti adulti, della struttura sanitaria dove si trovano a causa delle loro condizioni psicofisiche.', NULL, 1, 0, 0, '2016-02-15 13:44:57', '2016-02-15 14:49:14', 6, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(26, , 'image/jpeg', '57825', 'Salvini: "La magistratura italiana è una schifezza"', '"Rixi è un fratello e lo difenderò. Si preoccupi piuttosto della mafia e della camorra, che sono arrivate fino al Nord"', '"Se so che qualcuno, nella Lega, sbaglia sono il primo a prenderlo a calci nel c... e a sbatterlo fuori. Ma Rixi è un fratello e lo difenderò fino all''ultimo da quella schifezza che è la magistratura italiana. Si preoccupi piuttosto della mafia e della camorra, che sono arrivate fino al Nord". Così il segretario federale della Lega Nord, Matteo Salvini, dal palco del congresso piemontese del Carroccio. Salvini si riferisce alla ''Rimborsopoli'' ligure che vede l''assessore del Carroccio tra i rinviati a giudizio.', NULL, 0, 0, 0, '2016-02-15 13:51:57', '2016-02-15 13:51:57', 3, 1);
INSERT INTO `news` (`id`, `preview`, `previewtype`, `previewsize`, `title`, `subtitle`, `content`, `youtube_video`, `isHighlighted`, `votes_sum`, `votes_count`, `created_at`, `updated_at`, `idCategory`, `idUser`) VALUES
(27, , 'image/jpeg', '25393', 'Bce: audizione di Draghi al parlamento europeo: "Per la ripresa investimenti e tasse basse"', 'Bce: audizione di Draghi al parlamento europeo: "Per la ripresa investimenti e tasse basse"', ' "La ripresa prosegue a passo moderato, sostenuta soprattutto dalle nostre misure di politica monetaria e dall''impatto favorevole sulle condizioni finanziare e dai prezzi dell''energia. Gli investimenti restano deboli, e il settore delle costruzioni finora non si è ripreso. Per rendere l''eurozona più resiliente, la Bce è pronta a fare la sua parte e come annunciato esaminerà la possibilità di agire a inizio marzo": lo ha detto il presidente della Bce, Mario Draghi, in audizione a Strasburgo  \r\n\r\n"Diventa sempre più chiaro che le politiche di bilancio debbano sostenere la ripresa attraverso investimenti pubblici e tassazione bassa": ha detto Draghi. Inoltre, servono anche misure strutturali, per migliorare l''ambiente degli affari, le infrastrutture pubbliche, sono vitali per aumentare gli investimenti pubblici, aumentare il lavoro e la competitività". E "rispettare le regole del Patto resta essenziale per mantenere la fiducia nel quadro", ha aggiunto.\r\n\r\n"Da inizio dicembre - afferma ancora Draghi - un deterioramento del sentimento economico ha guadagnato velocità e nel tempo è diventato più volatile e suscettibile a cambiamenti rapidi. In questo ambiente i prezzi in Borsa sono scesi e i titoli bancari sono stati particolarmente colpiti, sia globalmente che in Europa, riflettendo l''alta sensibilità del settore alla prospettiva economica più debole del previsto". \r\n\r\n"La caduta dei titoli bancari - dice ancora Draghi - è stata amplificata dalla percezione che le banche potrebbero dover fare di più aggiustare i loro modelli di business ad un ambiente di bassa crescita e bassi interessi, e al rafforzato quadro regolatorio messo in piedi dall''inizio della crisi". "Bisogna riconoscere  - afferma - che le regole hanno messo le basi per un aumento della resilienza per tutto il settore finanziario".\r\n\r\n"La transizione alle nuove regole (della direttiva Brrd che istituisce il bail in, ndr), determina un cambiamento notevole, ma è un cambiamento per il meglio, perché così i soldi dei contribuenti non saranno utilizzati come accaduto nella crisi": lo ha detto il presidente della Bce Mario Draghi.', NULL, 0, 0, 0, '2016-02-15 14:46:07', '2016-02-15 14:46:07', 3, 1);

